import FullCalendar from "@fullcalendar/react";
import timeGridPlugin from "@fullcalendar/timegrid";
import { useState } from "react";
import { API } from "../../util/api/Api.js";
import "./home.css";

let api = new API();

function Home(props) {
  const [events, setEvents] = useState([]);
  const [number,setNumber] = useState(0);

  const addNumber=()=>{
    setNumber(number+1);
  }

  const clearEvents=()=>{
    setEvents([]);
  }

  const handleReloadClick = () => {
    return new Promise((resolve) => {
      api
        .getTriggerTimes()
        .then((res) => {
          clearEvents();
          const newEvents = [];
          res.data.message.forEach(element => {
            newEvents.push({
              title:"Event "+number,
              start: "2022-04-23T14:40:00",
              end: "2022-04-23T14:40:01",
            })
            setEvents(newEvents);
            console.log(newEvents);
            addNumber();
          });
        })
        .catch((err) => {
          console.log(err);
        });
    });
  };

  return (
    <div>
      <div>
        <FullCalendar
          plugins={[timeGridPlugin]}
          initialView="timeGridDay"
          allDaySlot={false}
          eventMinHeight={20}
          customButtons={{
            reload: {
              text: "Reload",
              click: function () {
                handleReloadClick();
              },
            },
          }}
          headerToolbar={{
            left: "reload,prev,next",
            right: "today,timeGridDay,timeGridWeek",
          }}
          eventClick={function (arg) {
            alert(arg.event.title);
            alert(arg.event.start);
          }}
          slotDuration="00:05:00"
          events={events}
        />
      </div>
    </div>
  );
}

export default Home;
